let currentScene = {}
let popupScene = {}
let inPopup = false
let musicPlayer = new Audio()
let currentSong = ""
let fadeInterval;
let inventoryEnabled = true;

const scenes = {};
const itemScenes = {};
const music = {};
const sounds = {};
const startScene = "";

const inventory = [];
const flags = new Set();
let lastInventory = [];
let lastFlags = new Set();


const engineSounds = {
    "select": "data:audio/wav;base64,",
    "error": "data:audio/wav;base64,"
}

function renderInventory() {
    const sceneTextElem = document.getElementById("scene-text")
    const choicesElem = document.getElementById("choices")
    const filledInventory = inventory.length > 0
    sceneTextElem.innerHTML = ""
    choicesElem.innerHTML = ""
    sceneTextElem.innerHTML = "Inventory:<br><br><span class=\"faint\">Empty :(</span>"
    if (filledInventory) {
        sceneTextElem.innerHTML = "Inventory:"
        inventory.forEach(item => {
            const itemElem = document.createElement("div");
            itemElem.onclick = () => {
                useItem(item);
                new Audio(engineSounds["select"]).play();
            }
            itemElem.innerHTML = `<span class=\"choice\">-${item}</span>`;
            choicesElem.appendChild(itemElem);
        });
    }
    
    if (filledInventory) {
        const lineBreak = document.createElement("br");
        choicesElem.appendChild(lineBreak);
    }

    const closeChoiceElem = document.createElement("div");
    closeChoiceElem.onclick = () => {
        closeInventory()
        new Audio(engineSounds["select"]).play();
    };
    closeChoiceElem.className = "cursor"
    closeChoiceElem.innerHTML = "<span class=\"choice\">-Close inventory.</span>";
    choicesElem.appendChild(closeChoiceElem);
}

function handleCondition(condition) {
    const type = condition.type
    const key = condition.key
    const value = condition.value
    switch (type) {
        case "item":
            return lastInventory.includes(key) == value
        case "flag":
            return lastFlags.has(key) == value
        default:
            throw new Error(`Found a condition with an unknown type: ${type}!`);
    }
}

function renderScene(scene, instant = false) {
    const sceneTextElem = document.getElementById("scene-text")
    const choicesElem = document.getElementById("choices")
    sceneTextElem.innerHTML = ""
    choicesElem.innerHTML = ""

    const sceneTexts = scene.scene_text
    const sceneChoices = scene.choices

    let finalSceneText = ""
    sceneTexts.forEach(sceneText => {
        const conditions = sceneText.conditions
        const text = sceneText.output
        const styleLookup = {
            undefined: "",
            "": "",
            "character name": "character-name",
            "link": "choice",
            "faint": "faint",
        }
        const style = sceneText.style
        let showsUp = true
        conditions.forEach(condition => {
            showsUp = showsUp && handleCondition(condition)
        })
        if (showsUp) {
            finalSceneText += `<span class="${styleLookup[style] ? styleLookup[style] : ""}">${text}</span>`
        }
    });

    sceneTextElem.innerHTML = finalSceneText;

    let i = 0
    sceneChoices.forEach(choice => {
        const conditions = choice.conditions
        const text = choice.text
        let showsUp = true
        if (conditions) {
            showsUp = conditions.every(condition => handleCondition(condition));  // i just learned about this!! :3
        }
        if (showsUp) {
            const choicElem = document.createElement("div");
            const id = i
            choicElem.onclick = () => {
                chooseOption(id);
                new Audio(engineSounds["select"]).play();
            }
            choicElem.className = "cursor"
            choicElem.innerHTML = `<span class=\"choice\">-${text}</span>`;
            choicesElem.appendChild(choicElem);
        }
        i++
    });

    if (inventoryEnabled) {
        const lineBreak = document.createElement("br");
        choicesElem.appendChild(lineBreak);
        const openInventoryChoiceElem = document.createElement("div");
        openInventoryChoiceElem.onclick = () => {
            openInventory();
            new Audio(engineSounds["select"]).play();
        };
        openInventoryChoiceElem.className = "cursor"
        openInventoryChoiceElem.innerHTML = "<span class=\"choice\">-Open inventory.</span>";
        choicesElem.appendChild(openInventoryChoiceElem);
    }
    inventoryEnabled = true;
}

function renderError(errorText) {
    new Audio(engineSounds["error"]).play();
    const sceneTextElem = document.getElementById("scene-text")
    const choicesElem = document.getElementById("choices")
    sceneTextElem.innerHTML = ""
    choicesElem.innerHTML = ""

    sceneTextElem.innerHTML = "<span class=\"error\">[ERROR: " + errorText + "]</span>";
    musicPlayer.pause();
    console.error(errorText)
}

function refreshPreviousData() {
    lastInventory = [...inventory]
    lastFlags = new Set([...flags])
}

function runSceneEvents(events) {
    refreshPreviousData()
    if (!events) return;
    events.forEach(event => {
        const value = event.value
        switch (event.type) {
            case "give_item":
                inventory.push(value);
                break;
            case "take_item":
                inventory.splice(inventory.indexOf(value), 1)
                break;
            case "set_flag":
                flags.add(value);
                break;
            case "unset_flag":
                flags.delete(value);
                break;
            case "music_change":
                playMusic(value)
                break;
            case "play_sound":
                new Audio(sounds[value]).play();
                break;
            case "disable_item_use":
                inventoryEnabled = false;
                break;
            default:
                renderError(`Attempted to use unknown scene event '${event.type}' with value '${value}'!`)
                break;
        }
    });
}

function runChoiceEvents(events) {
    refreshPreviousData()
    if (!events) return;
    events.forEach(event => {
        const value = event.value
        switch (event.type) {
            case "change_scene":
                const lastSceneName = currentScene.scene
                currentScene = scenes[value];
                if (!currentScene) {
                    renderError(`Scene '${value}' not found! Last scene: '${lastSceneName}'`)
                    break;
                }
                if (currentScene.events) {
                    runSceneEvents(currentScene.events);
                }
                renderScene(currentScene);
                break;
            case "give_item":
                inventory.push(value);
                break;
            case "set_flag":
                flags.add(value);
                break;
            case "unset_flag":
                flags.delete(value);
                break;
            case "play_sound":
                new Audio(sounds[value]).play();
                break;
            case "music_change":
                playMusic(value)
                break;
            case "disable_item_use":
                inventoryEnabled = false;
                break;
            case "close_popup":
                inPopup = false;
                renderScene(currentScene);
                break;
            default:
                renderError(`Attempted to use unknown choice event '${event.type}' with value '${value}'!`)
                break;
        }
    });
}

function openInventory() {
    renderInventory();
}

function closeInventory() {
    renderScene(currentScene, true);
}

function chooseOption(option) {
    const choice = inPopup ? popupScene.choices[option] : currentScene.choices[option]
    const conditions = choice.conditions
    if (conditions) {
        let valid = conditions.every(condition => handleCondition(condition));
        if (valid && choice.events) {
            runChoiceEvents(choice.events)
        }
    } else {
        runChoiceEvents(choice.events)
    }
}

function useItem(item) {
    let scene = itemScenes[snakeify(item) + "_" + currentScene.scene]
    if (scene) {
        inPopup = true
        popupScene = scene
        runSceneEvents(scene.events)
        renderScene(scene)
    } else {
        scene = itemScenes[snakeify(item)]
        if (scene) {
            inPopup = true
            popupScene = scene
            runSceneEvents(scene.events)
            renderScene(scene)
        }
    }
    
}

function snakeify(str) {
    return str && str.match(
        /[A-Z]{2,}(?=[A-Z][a-z]+[0-9]*|\b)|[A-Z]?[a-z]+[0-9]*|[A-Z]|[0-9]+/g)
        .map(s => s.toLowerCase())
        .join('_');
}

function playMusic(trackName) {
    if (currentSong === trackName) {
        return;
    }

    clearInterval(fadeInterval);

    if (musicPlayer && !musicPlayer.paused) {
        let volume = musicPlayer.volume;
        
        fadeInterval = setInterval(() => {
            volume -= 0.05;
            if (volume <= 0) {
                volume = 0;
                musicPlayer.pause();
                musicPlayer.volume = 1;
                clearInterval(fadeInterval);

                startNewTrack(trackName);
            }
            musicPlayer.volume = volume;
        }, 80);
    } else {
        startNewTrack(trackName);
    }
}

function startNewTrack(trackName) {
    currentSong = trackName;
    musicPlayer.src = music[trackName];
    musicPlayer.play();
    musicPlayer.loop = true;
    musicPlayer.volume = 0;

    fadeInterval = setInterval(() => {
        let volume = musicPlayer.volume;
        volume += 0.05;
        if (volume >= 1) {
            volume = 1;
            clearInterval(fadeInterval); 
        }
        musicPlayer.volume = volume;
    }, 80);
}

document.addEventListener("click", () => {
    runSceneEvents(currentScene.events);
    renderScene(currentScene);
}, { once: true });
currentScene = scenes[startScene]


window.addEventListener('load', function() {
    document.getElementById('choices').innerHTML = "▶ Click to Start"
});